import React from 'react';
import Layout from './Components/layout';
import { useTranslation } from "react-i18next";

function Home(){
  const { t } = useTranslation();
  return (
    <Layout>
      <div className="home">
        <div className="hero">
        <div className="big-title-Book">{t("hero-title-1")} </div>
        <div className="hero-child">
        <span className="big-title-Book"> {t("hero-title-2")}</span>
        <div className="big-title-BookItalic">{t("hero-title-3")}</div>
        </div>
        </div>
      </div>
    </Layout>
  );
};

export default Home;
